import React from 'react';
import { Header, BoardList } from 'components';
import 'App.css';

class Home extends React.Component {
    render(){
        let re = /(login|detail)/;
        let isAuth = re.test(this.props.location.pathname);

        return (
            <div>
               {isAuth ? undefined : <Header />}
               <BoardList/>
            </div>
        );
    }
}

export default Home;
